export default {
  name: 'RegulationsList',
  data: function data() {
    return {
      tableData: [],
      search: '',
      currentPage: 1,
      pageSize: 10,
      total: 0,
      loading: true
    };
  },
  mounted: function mounted() {
    this.getData();
  },
  methods: {
    btn: function btn() {
      this.$router.push({
        path: 'addRegulations'
      }); // 路由跳转页面
    },
    handleEdit: function handleEdit(index, row) {
      this.$router.push({
        name: 'UpdateRegulations',
        query: {
          regulationsId: row.regulationsId
        }
      });
    },
    handleDelete: function handleDelete(index, row) {
      var _this = this;

      this.$http.get(this.$url + 'regulations/delRegulations', {
        params: {
          'regulationsId': row.regulationsId
        }
      }).then(function (res) {
        if (res.data.code == '2001') {
          _this.$message({
            message: '删除成功',
            type: 'success'
          });

          _this.getData();
        } else {
          _this.$message.error('删除失败');
        }
      });
    },
    handleSizeChange: function handleSizeChange(size) {
      this.pageSize = size;
      this.getData();
    },
    handleCurrentChange: function handleCurrentChange(currentPage) {
      this.currentPage = currentPage;
      this.getData();
    },
    getData: function getData() {
      var _this2 = this;

      var params = new URLSearchParams();
      params.append('page', this.currentPage);
      params.append('limit', this.pageSize);
      this.$http.post(this.$url + 'regulations/showRegulations', params).then(function (res) {
        if (res.data.code == '2001') {
          _this2.loading = false;
          _this2.tableData = res.data.data;
          _this2.total = res.data.count;
        } else {
          _this2.total = res.data.count;
          _this2.loading = false;
          _this2.tableData = [];
        }
      });
    }
  }
};
